import React from "react";
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import styles from "./Leaderboard.module.scss";
import CountDown from "./CountDown.js";



const useStyles = makeStyles({
  table: {
    minWidth: 500,
  },
});

function createData(username, numClients, numProjects, commissionsEarned, total) {
  return { username, numClients, numProjects,commissionsEarned, total };
}

const rows = [
  createData('Frozen yoghurt', 1, 6,120, 2400),
  createData('Ice cream sandwich', 2, 4,90, 1800),
  createData('Eclair', 0, 0,0, 0),
  createData('Cupcake', 0, 0,0, 0),
  createData('Gingerbread', 0, 0,0, 0),
];

export default function Leaderboard() {
  const classes = useStyles();

  return (
  	<>
	<div className={styles.platformInfo}>

	<div>
	<span className={styles.platformInfoItem} >Affiliates: 5</span>
	<span className={styles.platformInfoItem}>Clients: 8</span>
	<span className={styles.platformInfoItem}>Projects: 8</span>
	<span className={styles.platformInfoItem}>Money received: 4200</span>
	<span className={styles.platformInfoItem}>commissions distributed: 210</span>
	</div>
	<CountDown/>
	<div>
	<span className={styles.platformInfoItem}>Money received: 4200</span>
	</div>

	<div>
	<span><img src={process.env.PUBLIC_URL + '/iconmonstr-trophy-17-32-gold.png'} alt="first prize"/>  168$</span>
	<span><img src={process.env.PUBLIC_URL + '/iconmonstr-trophy-17-32-silver.png'} alt="first prize"/> 84$</span>
	<span><img src={process.env.PUBLIC_URL + '/iconmonstr-trophy-17-32-bronze.png'} alt="first prize"/> 42$</span>
	</div>
	</div>

    <TableContainer component={Paper}>
      <Table className={classes.table} size="small" aria-label="a dense table">
        <TableHead>
          <TableRow>
            <TableCell>Affiliate</TableCell>
            <TableCell align="right">Number of Clients</TableCell>
            <TableCell align="right">Number of Projects</TableCell>
            <TableCell align="right">Comissions Earned</TableCell>
            <TableCell align="right">Total($)</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.username}>
              <TableCell component="th" scope="row">
                {row.username}
              </TableCell>
              <TableCell align="right">{row.numClients}</TableCell>
              <TableCell align="right">{row.numProjects}</TableCell>
              <TableCell align="right">{row.commissionsEarned}</TableCell>
              <TableCell align="right">{row.total}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
    </>
  );
}
